package y2019;

public class P15b {
	public static void main(String[] args) {
		String base = "";
		int offset = Integer.parseInt(base.substring(0, 7));
		StringBuilder sb = new StringBuilder();
		for (int i = 0; i < 10000; i++) sb.append(base);
		String inputString = sb.substring(offset);
		int[] inputChar = new int[inputString.length()];
		for (int i = 0; i < inputString.length(); i++)
			inputChar[i] = Integer.parseInt(String.valueOf(inputString.charAt(i)));
		for (int phase = 0; phase < 100; phase++) {
			int sum = 0;
			for (int i = inputChar.length - 1; i >= 0; i--) {
				sum += inputChar[i];
				inputChar[i] = sum % 10;
			}
		}
		for (int i = 0; i < 8; i++) System.out.print(inputChar[i]);
	}
}
